window.bookSummaryJSON = "<p><b>Sebastian</b></p> <p>I'm the good one, the pretty one. The one who follows the rules and always takes the high road.</p> <p>I've hidden my true self for so long I barely know who I am anymore. But I don't know if I can do it much longer.</p> <p>I love the race, but I'm tired of sacrificing my soul to do what I love.</p> <p><b>Axel</b></p> <p>I'm the rebel, the bad one. I follow no rules on the track or anywhere else. I'm the obnoxious bad boy the fans secretly root for.</p> <p>I don't mind playing my role. I'm good at it, and it pays to be the dark to his light. Until the good boy starts to get to me. I'm confused and unsure of what I want, when it was all so clear before.</p> <p>They say good always wins, but is that truly the case? In the race between the far-too-pretty good boy and the angry bad boy, who will actually win?</p> <p>Only time will tell.</p>"; 
